const SP500Return = () => {
  const [selectedAsset, setSelectedAsset] = useState<typeof ASSETS[0] | null>(null);
  const [data, setData] = useState<any>(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    if (!selectedAsset) return;

    const fetchData = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`${process.env.REACT_APP_API_URL || 'http://localhost:8000'}/api/v1/${selectedAsset.endpoint}/`, {
          params: { days: 3650 }
        });

        // Debugging: Check API response and structure
        console.log('API Response:', response.data);  // Check the response to ensure 'dtcai' is available

        // Ensure dtcai is available in the data, otherwise default to empty or some default value
        const logTransformedData = response.data.map((item: any) => ({
          date: item.date,
          log_close_price: item.close_price > 0 ? Math.log(item.close_price) : 0, // Apply log transformation if positive
          dtcai: item.dtcai || 0, // Ensure 'dtcai' exists, default to 0 if not available
        }));

        // Debugging: Check the transformed data
        console.log('Log Transformed Data:', logTransformedData);  // Check data transformation

        const chartData = {
          labels: logTransformedData.map((item: any) => item.date),
          datasets: [
            {
              label: `${selectedAsset.label} Log Price`,
              data: logTransformedData.map((item: any) => item.log_close_price),
              borderColor: selectedAsset.color,
              tension: 0.1,
              yAxisID: 'y',  // First y-axis for the log price
            },
            {
              label: 'DTCai', // Add DTCai to the graph
              data: logTransformedData.map((item: any) => item.dtcai),
              borderColor: 'rgb(255, 99, 132)', // Color for dtcai line
              tension: 0.1,
              borderDash: [5, 5], // Style for DTCai
              yAxisID: 'y1', // Second y-axis for DTCai
            },
          ],
        };
        setData(chartData);
        setError(null);
      } catch (err) {
        console.error('Error fetching data:', err);
        setError('Failed to load data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, [selectedAsset]);

  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top' as const,
      },
      title: {
        display: true,
        text: selectedAsset ? `${selectedAsset.label} - Last 5 Years` : '',
      },
    },
    scales: {
      y: {
        beginAtZero: false,
        position: 'left', // Position the primary y-axis on the left
      },
      y1: {
        beginAtZero: false,
        position: 'right', // Position the secondary y-axis on the right
        grid: {
          drawOnChartArea: false, // Disable grid lines for the second y-axis
        },
      },
      x: {
        reverse: true, // Ensure that the dates are ordered correctly
      },
    },
  };

  const handleBack = () => {
    setSelectedAsset(null);
    setData(null);
  };

  return (
    <div className="container mx-auto px-4 py-8">
      {!selectedAsset ? (
        <>
          <div style={{ width: '100%', height: '300px', marginBottom: '2rem', borderRadius: '0.75rem', overflow: 'hidden' }}>
            <img src="/yonsei_univ_photo.png" alt="Yonsei University" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
          </div>
          <div style={{ display: 'flex', flexDirection: 'row', gap: '1.5rem', overflowX: 'auto', paddingBottom: '1rem' }}>
            {ASSETS.map(asset => (
              <div
                key={asset.key}
                onClick={() => setSelectedAsset(asset)}
                style={{ 
                  minWidth: '300px',
                  padding: '1.5rem',
                  borderRadius: '0.75rem',
                  cursor: 'pointer',
                  border: '4px solid #d1d5db',
                  backgroundColor: 'white',
                  transition: 'all 0.3s'
                }}
                onMouseOver={(e) => {
                  e.currentTarget.style.borderColor = '#60a5fa';
                  e.currentTarget.style.boxShadow = '0 10px 15px -3px rgba(0, 0, 0, 0.1)';
                }}
                onMouseOut={(e) => {
                  e.currentTarget.style.borderColor = '#d1d5db';
                  e.currentTarget.style.boxShadow = 'none';
                }}
              >
                <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                  <img 
                    src={asset.img} 
                    alt={asset.label}
                    style={{ 
                      width: '32px',
                      height: '32px',
                      objectFit: 'contain'
                    }}
                  />
                  <div>
                    <h3 style={{ fontSize: '1.25rem', fontWeight: 'bold', color: '#1f2937' }}>{asset.label}</h3>
                    <p style={{ fontSize: '0.875rem', color: '#4b5563' }}>{asset.description}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </>
      ) : (
        <div className="bg-white rounded-xl shadow-lg p-6">
          <div className="flex justify-between items-center mb-6">
            <h2 className="text-2xl font-bold text-gray-800">{selectedAsset.label}</h2>
            <button
              onClick={handleBack}
              className="btn-gradient red block px-6 py-2 text-white font-medium rounded-lg transition-all duration-300 hover:shadow-lg"
              style={{
                background: 'linear-gradient(45deg, #1976d2, #42a5f5)',
                border: 'none',
                cursor: 'pointer'
              }}
            >
              ‚Üê Back to Assets
            </button>
          </div>
          {loading ? (
            <div className="flex justify-center items-center h-64">
              <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500"></div>
            </div>
          ) : error ? (
            <div className="text-red-500 text-center">{error}</div>
          ) : !data ? (
            <div className="text-center">No data available</div>
          ) : (
            <Line options={options} data={data} />
          )}
        </div>
      )}
    </div>
  );
};
